import React from 'react';
import { NavLink } from 'react-router-dom';
import './Navbar.css';

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="navbar-container">
        <NavLink to="/" className="navbar-logo">Grievance Website</NavLink>
        <div className="navbar-links">
          <NavLink to="/" className="nav-item" activeClassName="active">Home</NavLink>
          <NavLink to="/login" className="nav-item" activeClassName="active">Login</NavLink>
          <NavLink to="/register" className="nav-item" activeClassName="active">Register</NavLink>
          <NavLink to="/grievance" className="nav-item" activeClassName="active">Submit Grievance</NavLink>
          <NavLink to="/admin" className="nav-item" activeClassName="active">Admin Dashboard</NavLink>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
